"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[546],{2414:e=>{e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"category","label":"Introducci\xf3n","collapsible":true,"collapsed":false,"items":[{"type":"link","label":"Introducci\xf3n","href":"/docusaurus-website/docs/introduccion/introduccion","docId":"introduccion/introduccion","unlisted":false}]},{"type":"category","label":"C\xf3mo acceder al Inspector","collapsible":true,"collapsed":false,"items":[{"type":"link","label":"M\xe9todos de Acceso al Inspector","href":"/docusaurus-website/docs/acceso/como-acceder-inspector","docId":"acceso/como-acceder-inspector","unlisted":false}]},{"type":"category","label":"Paneles del Inspector","collapsible":true,"collapsed":false,"items":[{"type":"link","label":"Panel Elementos: Explorando el DOM","href":"/docusaurus-website/docs/paneles/panel-elementos","docId":"paneles/panel-elementos","unlisted":false},{"type":"link","label":"Panel Estilos: El Laboratorio CSS","href":"/docusaurus-website/docs/paneles/panel-estilos","docId":"paneles/panel-estilos","unlisted":false},{"type":"link","label":"Panel Consola: El Entorno Interactivo de JavaScript","href":"/docusaurus-website/docs/paneles/panel-consola","docId":"paneles/panel-consola","unlisted":false},{"type":"link","label":"Panel Fuentes: Depuraci\xf3n de C\xf3digo y Exploraci\xf3n de Archivos","href":"/docusaurus-website/docs/paneles/panel-fuentes","docId":"paneles/panel-fuentes","unlisted":false},{"type":"link","label":"Panel Red: Monitoreando el Tr\xe1fico de la Web","href":"/docusaurus-website/docs/paneles/panel-red","docId":"paneles/panel-red","unlisted":false},{"type":"link","label":"Panel Rendimiento: Optimizando la Velocidad de Ejecuci\xf3n","href":"/docusaurus-website/docs/paneles/panel-rendimiento","docId":"paneles/panel-rendimiento","unlisted":false},{"type":"link","label":"Panel Memoria: Diagn\xf3stico de Uso de Memoria y Fugas","href":"/docusaurus-website/docs/paneles/panel-memoria","docId":"paneles/panel-memoria","unlisted":false},{"type":"link","label":"Panel Aplicaci\xf3n: Explorando Recursos y Almacenamiento","href":"/docusaurus-website/docs/paneles/panel-aplicacion","docId":"paneles/panel-aplicacion","unlisted":false},{"type":"link","label":"Panel Seguridad: Evaluando la Conexi\xf3n Segura","href":"/docusaurus-website/docs/paneles/panel-seguridad","docId":"paneles/panel-seguridad","unlisted":false},{"type":"link","label":"Panel Lighthouse: Auditor\xedas de Calidad Web","href":"/docusaurus-website/docs/paneles/panel-lighthouse","docId":"paneles/panel-lighthouse","unlisted":false},{"type":"link","label":"Panel Recorder: Grabando y Reproduciendo Flujos de Usuario","href":"/docusaurus-website/docs/paneles/panel-recorder","docId":"paneles/panel-recorder","unlisted":false}]},{"type":"category","label":"Extras","collapsible":true,"collapsed":false,"items":[{"type":"link","label":"Potenciando el Inspector con Extensiones","href":"/docusaurus-website/docs/extras/extensiones","docId":"extras/extensiones","unlisted":false},{"type":"link","label":"Atajos de Teclado Esenciales","href":"/docusaurus-website/docs/extras/atajos-utiles","docId":"extras/atajos-utiles","unlisted":false}]}]},"docs":{"acceso/como-acceder-inspector":{"id":"acceso/como-acceder-inspector","title":"M\xe9todos de Acceso al Inspector","description":"Acceder a las Herramientas para Desarrolladores es el primer paso para empezar a trabajar con ellas. Aqu\xed detallamos los m\xe9todos m\xe1s comunes y eficientes.","sidebar":"tutorialSidebar"},"extras/atajos-utiles":{"id":"extras/atajos-utiles","title":"Atajos de Teclado Esenciales","description":"Los atajos de teclado son tus mejores amigos para navegar y usar el Inspector de Elementos con rapidez y eficiencia. Memorizar estos atajos comunes puede ahorrarte mucho tiempo al evitar tener que mover el rat\xf3n constantemente. Aqu\xed est\xe1n los m\xe1s \xfatiles, principalmente para navegadores basados en Chromium.","sidebar":"tutorialSidebar"},"extras/extensiones":{"id":"extras/extensiones","title":"Potenciando el Inspector con Extensiones","description":"El Inspector de Elementos ya es una suite de herramientas impresionante, pero su funcionalidad puede expandirse significativamente mediante extensiones del navegador dise\xf1adas para desarrolladores. Estas extensiones a\xf1aden nuevos paneles o caracter\xedsticas que se integran directamente en la interfaz del Inspector.","sidebar":"tutorialSidebar"},"introduccion/introduccion":{"id":"introduccion/introduccion","title":"Introducci\xf3n","description":"El Inspector de Elementos es una herramienta esencial integrada en los navegadores modernos, como Google Chrome, Mozilla Firefox y Microsoft Edge, que permite a los desarrolladores web explorar y depurar el contenido de una p\xe1gina web de manera din\xe1mica.","sidebar":"tutorialSidebar"},"paneles/panel-aplicacion":{"id":"paneles/panel-aplicacion","title":"Panel Aplicaci\xf3n: Explorando Recursos y Almacenamiento","description":"El panel Aplicaci\xf3n (Application) te ofrece una vista centralizada de diversos recursos y mecanismos de almacenamiento del lado del cliente que utiliza una p\xe1gina web. Es particularmente \xfatil para depurar caracter\xedsticas relacionadas con el rendimiento, la confiabilidad (ej. offline) y la interacci\xf3n con el navegador.","sidebar":"tutorialSidebar"},"paneles/panel-consola":{"id":"paneles/panel-consola","title":"Panel Consola: El Entorno Interactivo de JavaScript","description":"El panel Consola (Console) es tu portal de comunicaci\xf3n bidireccional con el entorno JavaScript de la p\xe1gina. Sirve para dos prop\xf3sitos principales: ver mensajes (errores, advertencias, logs) y ejecutar c\xf3digo interactivamente.","sidebar":"tutorialSidebar"},"paneles/panel-elementos":{"id":"paneles/panel-elementos","title":"Panel Elementos: Explorando el DOM","description":"El panel Elementos es el pilar central del Inspector. Es tu vista interactiva del Document Object Model (DOM), la estructura jer\xe1rquica de objetos que representa el contenido de la p\xe1gina web.","sidebar":"tutorialSidebar"},"paneles/panel-estilos":{"id":"paneles/panel-estilos","title":"Panel Estilos: El Laboratorio CSS","description":"El panel Estilos (Styles) es donde pasas la mayor parte de tu tiempo cuando depuras o ajustas la apariencia visual de una p\xe1gina. Muestra todas las reglas CSS que afectan al elemento seleccionado y te permite modificarlas en tiempo real.","sidebar":"tutorialSidebar"},"paneles/panel-fuentes":{"id":"paneles/panel-fuentes","title":"Panel Fuentes: Depuraci\xf3n de C\xf3digo y Exploraci\xf3n de Archivos","description":"El panel Fuentes (Sources) es tu cuartel general para ver el c\xf3digo fuente que compone la p\xe1gina y, lo m\xe1s importante, para depurar c\xf3digo JavaScript pausando su ejecuci\xf3n.","sidebar":"tutorialSidebar"},"paneles/panel-lighthouse":{"id":"paneles/panel-lighthouse","title":"Panel Lighthouse: Auditor\xedas de Calidad Web","description":"El panel Lighthouse integra la popular herramienta de auditor\xeda de c\xf3digo abierto de Google. Te permite ejecutar una serie de pruebas automatizadas para evaluar la calidad de tu p\xe1gina web en m\xfaltiples aspectos y obtener sugerencias accionables para mejorarla.","sidebar":"tutorialSidebar"},"paneles/panel-memoria":{"id":"paneles/panel-memoria","title":"Panel Memoria: Diagn\xf3stico de Uso de Memoria y Fugas","description":"El panel Memoria (Memory) es la herramienta principal para analizar el uso de memoria de tu aplicaci\xf3n web. Es crucial para identificar cu\xe1ndo la p\xe1gina consume demasiada memoria (lo que puede ralentizarla o hacerla colapsar) y, sobre todo, para detectar fugas de memoria.","sidebar":"tutorialSidebar"},"paneles/panel-recorder":{"id":"paneles/panel-recorder","title":"Panel Recorder: Grabando y Reproduciendo Flujos de Usuario","description":"El panel Recorder (Grabador) es una adici\xf3n relativamente nueva al Inspector que te permite grabar secuencias de interacciones del usuario (como clics, entradas de texto y navegaci\xf3n) y luego reproducirlas autom\xe1ticamente. Esto es muy \xfatil para automatizar pruebas de regresi\xf3n de flujos clave o para analizar el rendimiento de un camino de usuario espec\xedfico.","sidebar":"tutorialSidebar"},"paneles/panel-red":{"id":"paneles/panel-red","title":"Panel Red: Monitoreando el Tr\xe1fico de la Web","description":"El panel Red (Network) te proporciona una visi\xf3n completa de todas las solicitudes y respuestas de red que el navegador realiza mientras carga y interact\xfaa con una p\xe1gina. Es esencial para analizar el rendimiento de carga, depurar APIs y verificar que los recursos se cargan correctamente.","sidebar":"tutorialSidebar"},"paneles/panel-rendimiento":{"id":"paneles/panel-rendimiento","title":"Panel Rendimiento: Optimizando la Velocidad de Ejecuci\xf3n","description":"El panel Rendimiento (Performance) es una herramienta avanzada para analizar cu\xe1nto tiempo tarda tu p\xe1gina en hacer cosas despu\xe9s de que los recursos han sido cargados (aunque tambi\xe9n captura la carga inicial). Te ayuda a identificar y corregir problemas de rendimiento en el tiempo de ejecuci\xf3n, como JavaScript lento, rec\xe1lculos de estilo costosos o repintados excesivos.","sidebar":"tutorialSidebar"},"paneles/panel-seguridad":{"id":"paneles/panel-seguridad","title":"Panel Seguridad: Evaluando la Conexi\xf3n Segura","description":"El panel Seguridad (Security) proporciona informaci\xf3n sobre la seguridad de la conexi\xf3n de la p\xe1gina que est\xe1s visitando. Su enfoque principal es la seguridad de las conexiones HTTPS.","sidebar":"tutorialSidebar"}}}}')}}]);